<style>
  .info-panels-outer-wrapper{
    @apply
      flex
      justify-center
    ;
    width: 100vw;
    border: 3px solid red;
  }


/* ---------------------------------- Group ---------------------------------- */
  .info-panel-group-outer-wrapper{
    @apply
      flex
      flex-col
      mr-3 /* don't rly care for this -- attempt at center; issue likely borders - TODO */
    ;
    width: 100vw;
    max-height: 760px;
    border: solid 2px cyan;
  }  

  .info-panel-group-mid-wrapper{
    @apply
      flex
      flex-col
    ;
    width: 100%;
    height: 100%;
    /* background-image: url("https://dieupeut-bucket.us-east-1.linodeobjects.com/man_top.png"); */
    /* border: solid 1px red; */
  }

  .info-panel-group-inner-wrapper{
    @apply
      mx-[auto]
    ;
    max-width: 1280px; /* <-- weird, expected 1200px */
  }

/* /// ----------------- Group Footer --------------------- /// */

  .info-panel-group-footer-outer-wrapper{
    height: 140px;
    width: 100%;
    /* background-color: black; */
    /* background-image: url("https://i.pinimg.com/originals/50/3b/17/503b174d539eb6e6a2a8ceca6ced9b04.jpg"); */
    background-image: url("https://dieupeut-bucket.us-east-1.linodeobjects.com/cropped_night_landscape_1.png");
    background-size: 100%;
    background-position-y: -120px;
    overflow-x: hidden;
    /* border: 2px red solid; */
  }

  .info-panel-group-footer-mid-wrapper{
    height: 100%;
    width: 100%; 
    overflow: hidden;
    /* background-image: url("https://dieupeut-bucket.us-east-1.linodeobjects.com/man_bottom.png"); */
  }

  .info-panel-group-footer-inner-wrapper{
    @apply
      mx-[auto]
    ;
    display: grid;
    grid-template-columns: repeat(20, [col] 5%);
    width: 50%;
    height: 99%;
    border: 2px solid white;
  }

  .info-panel-group-footer-svg-wrapper{
    grid-column: col 1 / span 15;
    border: 2px solid purple;
  }
  
  .info-panel-group-footer-button-wrapper{
    @apply
      my-[auto]
      ml-[auto]
      mr-[10px]
    ;
    grid-column: col 16 / span 4;
  }

  .info-panel-group-footer-button{
    @apply
      flex
      text-black
      font-bold
      text-xl
      rounded-full
      bg-white
      my-[auto]
      py-2
      px-8
      mx-2
      /* text-[clamp(28px,8.5vw,30px)] */
    ;
    white-space: nowrap;
    text-decoration: none;
    will-change: transform;
  }

  .info-panel-group-footer-button:hover{
    transition-duration: 200ms;
    transform: scale(1.1);
    transition-timing-function: cubic-bezier(0.4,0,2,1);
  }


/* ---------------------------------- Panel 1 ---------------------------------- */
  #info-panel-1-outer-wrapper{
    border: 2px solid blue; 
  }

  #info-panel-1-mid-wrapper{
    background-image: url("https://dieupeut-bucket.us-east-1.linodeobjects.com/crop_kids_portrait_8_top.png");
    background-size: 500px;
    background-repeat: no-repeat;
    background-position-x: -40px;
    background-position-y: bottom;
  }

  #info-panel-1-inner-wrapper{
    position: relative;
    margin-top: 40px;
    height: 600px;
    /* border: 2px solid black; */
  } 

  #info-panel-1-stats-grid{
    @apply
      flex
      justify-around
    ;
    position: relative;
    display: grid;
    grid-template-columns: repeat(3, [col] 30%);
    grid-template-rows: 100%;
    grid-gap: 2px;

    width: 100%;
    height: 150px;
    border: 2px solid green;
  }

  .info-panel-1-stat-group{
    @apply
      flex
      flex-col
      text-xl
      justify-around
    ;
    width: 100%;
    text-align: center;
    font-weight: 700; 
